import React from "react";
import "./styles.css";

function App() {
  return (
    <div className="App">
      <div className="container">
        <button className="logo">Code Editor</button>
        <button className="logo">Portfolio</button>
        <button className="logo">Strategy Management</button>
      </div>
      <button className="login">Login</button>
    </div>
  );
}

export default App;
